import React, { Component } from 'react';
//import Header from "./Header";

import {Route, Switch} from 'react-router-dom';

import Ui from './Ui';

class Home extends Component {
  render() {
      return (
        <Switch>    
        <Route exact path="/" component={Home} />
        <Route path="/about" component={Ui} />
        </Switch>
      );
  }
}


export default Home;
